import React from 'react';
import styled from "styled-components";
import {Container} from "../../styles/common";

const StyledNews = styled(Container)`
  padding-top: 9rem;
  padding-bottom: 9rem;
`

const NewsHeader = styled.div`
  display: flex;
  align-items: end;
  justify-content: space-between;
`

function News() {
  return (
    <StyledNews>
      <NewsHeader>
        
      </NewsHeader>
    </StyledNews>
  );
}

export default News;
